  \"High SBS-Threshold Er/Yb Co-Doped Phosphate Glass Fiber Amplifiers for High Power,
  Sub-us Pulsed, Narrow Linewidth, All Fiber-Based Laser Transmitter Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T05:58:00.866241\",\n\t\"name\": \"high-sbs-threshold-er-yb-co-doped-phosphate-glass-fiber-amplifiers-for-high-power-sub-us-p\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In order to implement the monolithic high
  power narrow linewidth pulsednall fiber-based laser transmitter by using a MOPA
  configuration fornNASA's active remote sensing spectroscopy, NP Photonics propose
  tondevelop the high SBS-threshold, single-mode (SM), polarizationnmaintaining (PM),
  high power amplifiers for the sub-microsecond pulsesnwith transform-limited linewidth,
  leveraging on NP's proprietarynpatented large core SM PM highly Er/Yb co-doped phosphate
  glass fibersn(LC-EYPhF). We will use our proprietary patented single-frequencynQ-switched
  fiber laser seed that we have developed recently in order tonmake the whole high
  power narrow linewidth pulsed fiber laserntransmitter compact and expandable to
  spaceborne or UAV platforms. InnPhase I, one new SM PM LC-EYPhF fiber with large
  core of 25 micron willnbe fabricated and two power amplifier stages using NP's large
  corenhighly co-doped Er/Yb phosphate glass fibers will be implemented innorder to
  demonstrate 5-kW peak power and 2.5-mJ pulse energy withnSBS-free for NASA's active
  remote sensing fiber laser pulses at 765 nmnby using NP's SINGLE-MODE phosphate
  fiber amplifiers.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
